import React from "react";
import { useNavigate } from "react-router-dom";
import "../style/footer.css";

function Footer() {
  const navigation = useNavigate();
  return (
    <div className="footer">
      <div className="rightfooter">
        <p> Adderess : Rewa Madhya pradesh , INDIA</p>
        <p>Contact no: +91-903923-0788</p>
        <p>E-mail : shivamsingh01042001@gmail.com</p>
      </div>
      <div className="leftfooter">
        <p>About Shivam .</p>
        <p>
          This is Shivam singh. <br />
          Frontend Developer Trainee at DigiKull.
          <br /> I enjoy Developing new Projects <br />
          and design challenges
        </p>
        <div>
          <a href="https://www.linkedin.com/in/shivam-singh-a9405324b/">
            {" "}
            <img src="data:image/png;base64," />{" "}
          </a>
          <img src="https://cdn.pixabay.com/photo/2022/01/30/13/33/github-6980894_1280.png" />
        </div>
      </div>
    </div>
  );
}

export default Footer;
